import "./App.css";
import { BrowserRouter as Router,Routes,Link } from "react-router-dom";
import Header from "./components/Header/Header";
import Footer from "./components/Footer/Footer";

function App() {
  return (
    <div className='App'>
      <Router>

        <Header></Header>

        <Footer></Footer>

      </Router>
    </div>
  );
}

export default App;
